              </Link>
          </div>  
          
            <div className="overflow-y-scroll h-96">
                <TablaProductos listaproductos={productos} />
                <ToastContainer position="bottom-center" autoClose={5000} />
            </div>
        </div>
    );}

const TablaProductos = ({listaproductos}) => {
    return (
        <div className="flex items-center justify-center">
            <table className="border-2">
                <thead className="border-2 font-semibold">
                    <tr>
                        <th>Id</th>
                        <th>Descripción</th>
                        <th>Valor</th>
                        <th>Estado</th> 
                        <th>Acción</th>
                    </tr>
                </thead>
                <tbody className="border-2">{listaproductos.map((productos) => {                    
                    return (
                        <tr className="ml-20" className="bg-aqua  border-2 text-center justify-center">
                            <td  > {productos.id} </td>
                            <td> {productos.descripcion} </td>
                            <td> {productos.valor} </td>
                            <td> {productos.estado} </td>
                            <td>
                                <div className='flex w-full justify-around'>
                                    {edit ? (
                                        <>
                                            <Tooltip title='Confirmar Edición' arrow>
                                                <i
                                                    onClick={() => actualizarVehiculo()}
                                                    className='fas fa-check text-green-700 hover:text-green-500'
                                                />
                                            </Tooltip>
                                            <Tooltip title='Cancelar edición' arrow>
                                                <i
                                                    onClick={() => setEdit(!edit)}
                                                    className='fas fa-ban text-yellow-700 hover:text-yellow-500'
                                                />
                                            </Tooltip>
                                        </>
                                    ) : (
                                        <>
                                            <Tooltip title='Editar Vehículo' arrow>
                                                <i
                                                    onClick={() => setEdit(!edit)}
                                                    className='fas fa-pencil-alt text-yellow-700 hover:text-yellow-500'
                                                />
                                            </Tooltip>
                                            <Tooltip title='Eliminar Vehículo' arrow>
                                                <i
                                                    onClick={() => setOpenDialog(true)}
                                                    className='fas fa-trash text-red-700 hover:text-red-500'
                                                />
                                            </Tooltip>
                                        </>
                                    )}
                                </div>
                                <Dialog open={openDialog}>
                                    <div className='p-8 flex flex-col'>
                                        <h1 className='text-gray-900 text-2xl font-bold'>
                                            ¿Está seguro de querer eliminar el vehículo?
                                        </h1>
                                        <div className='flex w-full items-center justify-center my-4'>
                                            <button
                                                onClick={() => eliminarVehiculo()}
                                                className='mx-2 px-4 py-2 bg-green-500 text-white hover:bg-green-700 rounded-md shadow-md'
                                            >
                                                Sí
                                            </button>
                                            <button
                                                onClick={() => setOpenDialog(false)}
                                                className='mx-2 px-4 py-2 bg-red-500 text-white hover:bg-red-700 rounded-md shadow-md'
                                            >
                                                No
                                            </button>
                                        </div>
                                    </div>
                                </Dialog>
                            </td>
                        </tr>
                    );
                    })}
                </tbody>
            </table>
    </div>
    )
}

export default ListProductos
